// LandingPage.js

import React from 'react';
import Logo from './Logo';
import Footer from './Footer';
import { Link } from 'react-router-dom';

function LandingPage() {
    return (
        <div className="App min-h-screen pt-6 w-full pr-8 pb-6" style={{ background: '#111', backgroundImage: `url(${process.env.PUBLIC_URL}/smoky_background.jpg)`, backgroundPosition: 'left', backgroundRepeat: 'no-repeat', backgroundSize: 'cover' }}>
            <div className="flex flex-col justify-center items-center h-full">
                <Logo />
                <Link to="/chat" className="chat-link mt-16 text-2xl text-white py-2 px-6 rounded-lg transition duration-150 bg-gray-800 hover:bg-gray-700">Go to Chat Box</Link>
            </div>
            <Footer />
        </div>
    );
}

export default LandingPage;
